import React from 'react'
import ListGroup from 'react-bootstrap/ListGroup';


export default function Pokemons({pokemon}) {
    return (
        <div class="w-75">
        <ListGroup variant="flush" >
            {pokemon.map(p=>(
                <ListGroup.Item action variant="info" className="d-flex justify-content-center">{p}</ListGroup.Item>
            ))}
        </ListGroup>
        </div>
    )
}
